import React, { Component } from 'react'
import { FiMenu } from 'react-icons/fi';
import './index.scss';

export class HeaderDashboard extends Component {
    render() {
        return (
            <header className="header dashboard p-3">
                <FiMenu />
            </header>
        )
    }
}

export default HeaderDashboard
